import React from 'react';
// import { connect } from 'react-redux'

class Home extends React.Component {
  state = { is_favorites: false }

  render() {
    return (
      <div>
        <h1>{this.state.is_favorites === false}</h1>
        Hello this is the weather app home
      </div>
    );
  }
}

